import React from "react";


function Register() {

    return(

        <div>

            <h1>Register</h1>

            <form>

                <input type="text" name="full name" />
                <input type="email" name="email" />
                <input type="password" name="password" />
                <input type="button" name="Enviar" />



            </form>

        </div>

    )
}

export default Register;
